    false,nt"url": null,nt"notes": "The long and consistent records of escapement
    that have been obtained in Prince William Sound show clearly that there is a direct
    relation between the number of spawners and the subsequent return of adult pink
    salmon two years later. In this paper the relationship between the catch, escapement
    and return for the last seventeen years is presented. From these data are derived
    the most probable return for 1957 and the reliability of the prediction.",nt"license_title":
